import React from 'react';
import Nav from './nav';


function toggleDropdown() {

var dropdownContent = document.getElementById('dropdown-content');
  if (dropdownContent.style.display === 'block') {
    dropdownContent.style.display = 'none';
  } else {
    dropdownContent.style.display = 'block';
  }

}

function Header() {
  return (
    <header className="header-content" style={{paddingLeft: "25px", paddingRight: "25px"}}>
        <div id="header-mobile">
          <div className="dropdown" style={{position: "relative"}}>
            <button className="dropdown-btn" onClick="toggleDropdown()">â˜°</button>

            <div id="dropdown-content" className="dropdown-content">
              dropdown content box
            </div>
          </div>



        </div>

          <div id="nav-desktop">
            <div id="nav-container" className="nav-content">
              <img style={{height: "60px"}} src="logo-wide.png" alt="Little Lemon Logo" />
              <Nav />
            </div>
          </div>

    </header>
  );
}

export default Header;
